import { useState, useEffect } from "react";
// import { Data } from "./emogiJson";

export const Main = () => {
  const url = " https://emoji.ymatuhin.workers.dev/";
  const [Data,setData] = useState([]);
  let DisplayInput = () => (  <div>
        <input onChange={(event) =>setData(event.target.value)} />
        {/* <div>{console.log(Data)}</div> */}
      </div>
    );


  //   const Data = (event) => event.target.value;
  const getData = async () => {
    let response = await fetch(url);
    let makeJson = await response.json();
setData(makeJson);
  };
  useEffect(async () => {
    DisplayInput();
    getData();
  }, []);
  return Data.map((elem) => (
    <div>
      <div>{elem.title}</div>
      <div>{elem.symbol}</div>
      <div>{elem.keywords}</div>
    </div>
  ));
};
